import React , {Component} from 'react';
import mergeImages from 'merge-images';

var marge;
export default class Img extends Component {
  
  constructor(props){
    super(props);
}

marge = function merge(){
  return mergeImages(this.props.listado);
}


render(){
    return (
         <div>
             <p>{merge}</p>
         </div>
    );
  }
 
}
